SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
SELECT DropGeometryColumn('','place','geom');
DROP TABLE "place";
BEGIN;
CREATE TABLE "place" (gid serial,
"name" varchar(254),
"elevation" numeric);
ALTER TABLE "place" ADD PRIMARY KEY (gid);
SELECT AddGeometryColumn('','place','geom','4326','POINT',2);
CREATE INDEX ON "place" USING GIST ("geom");
COMMIT;
